import React from "react";

export const DownloadExcel = () => {
  const downloadSampleExcel = (fileName) => {
    const downloadLink = document.createElement("a");
    downloadLink.href = `{/${fileName}.xlsx}`; //"/fileName.xlsx"; // Path to your Excel sheet
    downloadLink.download = `{${fileName}.xlsx}`; //"sample.xlsx"; // Desired download file name
    downloadLink.click();
  };

  return (
    <div className="App">
      <div>
        <div>Sample Excel Download</div>
        <button onClick={() => downloadSampleExcel("Employee")}>
          employee
        </button>
        <button onClick={() => downloadSampleExcel("Training")}>
          Training
        </button>
      </div>
    </div>
  );
};
